hex_data = ''
binary_data = bytes.fromhex(hex_data[10:])
import gzip
import io

result2=[]

with gzip.GzipFile(fileobj=io.BytesIO(binary_data)) as f:
    decompressed_data = f.read()

# print(decompressed_data)
result=[]
for i in range(len(decompressed_data)):
    for j in range(i,len(decompressed_data)):
        try:
            result.append(decompressed_data[i:j].decode('utf-8'))
            print(decompressed_data[i:j].decode('utf-8'))
        except (UnicodeDecodeError,ValueError):
            break

def write_txt(filename,File):
    with open(f"{filename}.txt", "w", encoding="utf-8") as file:
        for item in File:
            file.write(str(item) + "\n")

write_txt('result',result)





